gay từ khi xuất bản phần một (Harry Potter and the Philosopher\'s Stone – ấn bản Anh; Harry Potter and the Sorcerer\'s Stone - ấn bản Mỹ; Harry Potter và Hòn đá Phù thủy – bản dịch tiếng Việt) vào ngày 30 tháng 6 năm 1997, bộ truyện ngày càng nổi tiếng trên toàn thế giới, được giới phê bình hoan nghênh và rất thành công về mặt thương mại[2]. Bộ truyện cũng nhận được một số lời chỉ trích, bao gồm cả việc lo ngại về vẻ đen tối ngày càng tăng. Đến tháng 2 năm 2018, cả bảy quyển đã bán được hơn 500 triệu bản, trở thành bộ sách bán chạy nhất trong lịch sử và được dịch sang 67 ngôn ngữ[3]. Phần bảy, và cũng là phần cuối cùng, Harry Potter and the Deathly Hallows (Harry Potter và Bảo bối Tử thần) xuất bản vào ngày 21 tháng 7 năm 2007. Hơn 11 triệu quyển đã được bán trong 24 giờ đầu tiên[4].\n\nNhờ vào sự thành công của bộ truyện, J. K. Rowling đã trở thành nhà văn giàu nhất trong lịch sử văn học. Những bản in bằng tiếng Anh được phát hành bởi nhà xuất bản Bloomsbury ở Vương quốc Liên hiệp Anh và Bắc Ireland, Scholastic Press ở Mỹ, Allen & Unwin ở Úc và Raincoast Books ở Canada. Tại Việt Nam, bộ truyện này được Nhà xuất bản Trẻ xuất bản từ bản dịch của dịch giả Lý Lan.\n\nCả bộ truyện 7 quyển, với quyển thứ 7 được chia thành 2 phần, dựng thành 8 bộ phim trong loạt phim cùng tên phát hành bởi Warner Bros. Pictures, trở thành loạt phim có doanh thu cao nhất mọi thời đại, kéo theo thương hiệu Harry Potter có giá trị hơn 25 tỷ USD[5].',199000,99,'2022-12-24 17:43:23');
